            }
            {
                props.tempreature && <p>city: { props.city }</p>
            }
            {
                props.tempreature && <p>country: { props.country }</p>
            }
            {
                props.tempreature && <p>humidity: { props.humidity }</p>
            }
            {
                props.tempreature && <p></p>
            }
            {
                props.tempreature && <p>description: { props.description }</p>
            }
        </div>
        );

}

export default Weather;
